import React from "react";
import Column from "table-column";
const table = (props) => {
  const data = { props };
  const titles = Object.keys(data[0]);
  return (
    <div>
      <h2>Frequently Requested Materials</h2>
      <table>
        <thead>
          <tr>
            {titles.map((title) => (
              <th key={title}>{title}</th>
            ))}
          </tr>
        </thead>

        <tbody>
          {data.map((row, i) => (
            <Column row={row} />
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default table;
